contract DeerToken is Context, IERC20, Ownable {
    mapping(address => uint256) private _rOwned;
    mapping(address => uint256) private _tOwned;
    mapping(address => mapping(address => uint256)) private _allowances;
    mapping(address => bool) private _isExcluded;
    mapping(address => bool) private _addressPair;
    mapping(address => bool) private _isExcludedFromFee;
    address public constant DEADADDRESS =
        0x000000000000000000000000000000000000dEaD;
    uint256 private constant MAX = ~uint256(0);
    uint256 private tTOTAL = 1000000000 * 10**18;
    uint256 private rTotal = (MAX - (MAX % tTOTAL));
    uint256 private tFeeTotal;
    address payable public mainAddress =
        payable(0xfA3487efB5E69aeC042c7A503987C0BD7ac64C2D);
    string private constant TOKENNAME = "Deer Token";
    string private constant TOKENSYMBOL = "DEER";
    uint8 private constant TOKENDECIMALS = 18;
    uint256 public maxTxAmountPerc = 5000000 * 10**18;
    uint256 public rewardFeePercS = 1;
    uint256 public marketingFeePercS = 3;
    uint256 public burnFeePercS = 1;
    uint256 public rewardFeePercB = 1;
    uint256 public marketingFeePercB = 3;
    uint256 public burnFeePercB = 1;
    address[] private _excluded;
    IUniswapV2Router02 public uniswapV2Router;
    address public immutable uniswapV2Pair;

    bool inSwapAndMarketing;
    bool public constant SWAPANDMARKETINGENABLED = true;

    uint256 public numTokensSellToAddToMarketing = 10000 * 10**18;

    event SwapTokensForETH(uint256 amountIn, address[] path);
    event SetMaxTx(uint256 maxTx);
    event SetTOTALBFees(uint256 setTotFees);
    event SetTOTALSFees(uint256 setTotFees);
    event SetNumTokensToMarketing(uint256 tokenToMarketing);
    event ExcludeAddressPair(address account, bool value);
    event IncludeAddressPair(address account, bool value);
    event ExcludeFromFees(address account, bool value);
    event IncludeFromFees(address account, bool value);
    event TransferFailed(address recipient, uint256 amount);

    modifier lockTheSwap() {
        inSwapAndMarketing = true;
        _;
        inSwapAndMarketing = false;
    }

    constructor() {
        _rOwned[_msgSender()] = rTotal;
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(
            0x10ED43C718714eb63d5aA57B78B54704E256024E //0x10ED43C718714eb63d5aA57B78B54704E256024E
        );
        _isExcludedFromFee[owner()] = true;
        emit ExcludeFromFees(owner(), true);
        _isExcludedFromFee[mainAddress] = true;
        emit ExcludeFromFees(mainAddress, true);
        _isExcludedFromFee[address(this)] = true;
        emit ExcludeFromFees(address(this), true);
        excludeFromReward(DEADADDRESS);
        excludeFromReward(address(0));
        address _uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), _uniswapV2Router.WETH());
        uniswapV2Router = _uniswapV2Router;
        uniswapV2Pair = _uniswapV2Pair;
        includeFromAddressPair(_uniswapV2Pair);
        emit Transfer(address(0), _msgSender(), tTOTAL);
    }

    function setFeesSell(
        uint256 _rewardFeeS,
        uint256 _marketingFeeS,
        uint256 _burnFeeS
    ) external onlyOwner {
        marketingFeePercS = _marketingFeeS;
        rewardFeePercS = _rewardFeeS;
        burnFeePercS = _burnFeeS;
        emit SetTOTALSFees(marketingFeePercS + rewardFeePercS + burnFeePercS);
    }

    function setFeesBuy(
        uint256 _rewardFeeB,
        uint256 _marketingFeeB,
        uint256 _burnFeeB
    ) external onlyOwner {
        marketingFeePercB = _marketingFeeB;
        rewardFeePercB = _rewardFeeB;
        burnFeePercB = _burnFeeB;
        emit SetTOTALBFees(marketingFeePercB + rewardFeePercB + burnFeePercB);
    }

    function name() public pure returns (string memory) {
        return TOKENNAME;
    }

    function symbol() public pure returns (string memory) {
        return TOKENSYMBOL;
    }

    function decimals() public pure returns (uint8) {
        return TOKENDECIMALS;
    }

    function totalSupply() public view override returns (uint256) {
        return tTOTAL;
    }

    function balanceOf(address account) public view override returns (uint256) {
        if (_isExcluded[account]) return _tOwned[account];
        return tokenFromReflection(_rOwned[account]);
    }

    function transfer(address recipient, uint256 amount)
        public
        override
        returns (bool)
    {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender)
        public
        view
        override
        returns (uint256)
    {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount)
        public
        override
        returns (bool)
    {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function manualSendMa() external onlyOwner {
        uint256 contractETHBalance = address(this).balance;
        payable(mainAddress).transfer(contractETHBalance);
    }

    function setMainAddress(address _mainAddress) external onlyOwner {
        require(
            mainAddress != _mainAddress,
            "DeerToken: Main Address must be different than before"
        );
        require(
            _mainAddress != address(0),
            "DeerToken: Main Address cannot be the zero address"
        );
        mainAddress = payable(_mainAddress);
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(
            sender,
            _msgSender(),
            _allowances[sender][_msgSender()] - amount
        );
        return true;
    }

    function excludeFromAddressPair(address account) public onlyOwner {
        require(_addressPair[account], "address is already excluded");
        _addressPair[account] = false;
        emit ExcludeAddressPair(account, false);
    }

    function includeFromAddressPair(address account) public onlyOwner {
        require(!_addressPair[account], "address is already included");
        _addressPair[account] = true;
        emit IncludeAddressPair(account, true);
    }

    function excludeFromFee(address account) public onlyOwner {
        require(!_isExcludedFromFee[account], "address is already excluded");
        _isExcludedFromFee[account] = true;
        emit ExcludeFromFees(account, true);
    }

    function includeInFee(address account) public onlyOwner {
        require(_isExcludedFromFee[account], "address is already included");
        _isExcludedFromFee[account] = false;
        emit IncludeFromFees(account, false);
    }

    function isExcludedFromFee(address account) public view returns (bool) {
        return _isExcludedFromFee[account];
    }

    function isExcludedFromReward(address account) public view returns (bool) {
        return _isExcluded[account];
    }

    function deliver(uint256 tAmount, bool isBuy) public {
        address sender = _msgSender();
        require(
            !_isExcluded[sender],
            "Excluded addresses cannot call this function"
        );
        (uint256 rAmount, , , , , ) = _getValues(tAmount, isBuy);
        _rOwned[sender] = _rOwned[sender] - rAmount;
        rTotal = rTotal - rAmount;
        tFeeTotal = tFeeTotal + tAmount;
    }

    function excludeFromReward(address account) public onlyOwner {
        // require(account != 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D, 'We can not exclude Uniswap router.');
        require(!_isExcluded[account], "Account is already excluded");
        if (_rOwned[account] > 0) {
            _tOwned[account] = tokenFromReflection(_rOwned[account]);
        }
        _isExcluded[account] = true;
        _excluded.push(account);
    }

    function includeInReward(address account) external onlyOwner {
        require(_isExcluded[account], "Account is already excluded");
        require(account != DEADADDRESS, "Change address to included");
        require(account != address(0), "Change address to included");
        for (uint256 i = 0; i < _excluded.length; i++) {
            if (_excluded[i] == account) {
                _excluded[i] = _excluded[_excluded.length - 1];
                _tOwned[account] = 0;
                _isExcluded[account] = false;
                _excluded.pop();
                break;
            }
        }
    }

    function setNumTokensSellToAddToMarketing(
        uint256 _numTokensSellToAddToMarketing
    ) external onlyOwner {
        require(
            numTokensSellToAddToMarketing !=
                _numTokensSellToAddToMarketing * 10**18,
            "DeerToken: NumTokenSellToMarketing must be different than before"
        );
        numTokensSellToAddToMarketing = _numTokensSellToAddToMarketing * 10**18;
        emit SetNumTokensToMarketing(_numTokensSellToAddToMarketing);
    }

    function setMaxTxAmount(uint256 _maxTxAmount) external onlyOwner {
        require(
            maxTxAmountPerc != _maxTxAmount * 10**18,
            "DeerToken: MaxTxAmount must be different than before"
        );
        maxTxAmountPerc = _maxTxAmount * 10**18;
        emit SetMaxTx(_maxTxAmount);
    }

    function increaseAllowance(address spender, uint256 addedValue)
        public
        virtual
        returns (bool)
    {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender] + addedValue
        );
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue)
        public
        virtual
        returns (bool)
    {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender] - subtractedValue
        );
        return true;
    }

    function totalFees() public view returns (uint256) {
        return tFeeTotal;
    }

    function reflectionFromToken(
        uint256 tAmount,
        bool deductTransferFee,
        bool isBuy
    ) public view returns (uint256) {
        require(tAmount <= tTOTAL, "Amount must be less than supply");
        if (!deductTransferFee) {
            uint256 currentRate = _getRate();
            uint256 rAmount = tAmount * currentRate;
            return rAmount;
        } else {
            (, uint256 rTransferAmount, , , , ) = _getValues(tAmount, isBuy);
            return rTransferAmount;
        }
    }

    function tokenFromReflection(uint256 rAmount)
        public
        view
        returns (uint256)
    {
        require(
            rAmount <= rTotal,
            "Amount must be less than total reflections"
        );
        uint256 currentRate = _getRate();
        return rAmount / currentRate;
    }

    receive() external payable {}

    function _reflectFee(uint256 rFee, uint256 tFee) private {
        rTotal = rTotal - rFee;
        tFeeTotal = tFeeTotal + tFee;
    }

    function _getValues(uint256 tAmount, bool isBuy)
        private
        view
        returns (
            uint256,
            uint256,
            uint256,
            uint256,
            uint256,
            uint256
        )
    {
        (
            uint256 tTransferAmount,
            uint256 tFee,
            uint256 tMarketing,
            uint256 tBurn
        ) = _getTValues(tAmount, isBuy);
        (uint256 rTransferAmount, uint256 rFee) = _getRValues(
            tAmount,
            tBurn,
            tFee,
            tMarketing,
            _getRate()
        );
        return (
            tBurn,
            rTransferAmount,
            tTransferAmount,
            rFee,
            tFee,
            tMarketing
        );
    }

    function _getTValues(uint256 tAmount, bool isBuy)
        private
        view
        returns (
            uint256,
            uint256,
            uint256,
            uint256
        )
    {
        uint256 tFee = calculateRewardFee(tAmount, isBuy);
        uint256 tMarketing = calculateMarketingFee(tAmount, isBuy);
        uint256 tBurn = calculateBurnFee(tAmount, isBuy);
        uint256 tTransferAmount = ((tAmount - tFee) - tMarketing) - tBurn;
        return (tTransferAmount, tFee, tMarketing, tBurn);
    }

    function _getRValues(
        uint256 tAmount,
        uint256 tBurn,
        uint256 tFee,
        uint256 tMarketing,
        uint256 currentRate
    ) private pure returns (uint256, uint256) {
        uint256 rAmount = tAmount * currentRate;
        uint256 rFee = tFee * currentRate;
        uint256 rMarketing = tMarketing * currentRate;
        uint256 rBurn = tBurn * currentRate;
        uint256 rTransferAmount = ((rAmount - rFee) - rMarketing) - rBurn;
        return (rTransferAmount, rFee);
    }

    function getValueNoFee(uint256 tAmount, uint256 currentRate)
        private
        pure
        returns (uint256, uint256)
    {
        uint256 rAmount = tAmount * currentRate;
        uint256 rTransferAmountNoFee = rAmount;
        return (rAmount, rTransferAmountNoFee);
    }

    function _getRate() private view returns (uint256) {
        (uint256 rSupply, uint256 tSupply) = _getCurrentSupply();
        return rSupply / tSupply;
    }

    function _getCurrentSupply() private view returns (uint256, uint256) {
        uint256 rSupply = rTotal;
        uint256 tSupply = tTOTAL;
        for (uint256 i = 0; i < _excluded.length; i++) {
            if (
                _rOwned[_excluded[i]] > rSupply ||
                _tOwned[_excluded[i]] > tSupply
            ) return (rTotal, tTOTAL);
            rSupply = rSupply - _rOwned[_excluded[i]];
            tSupply = tSupply - _tOwned[_excluded[i]];
        }
        if (rSupply < rTotal / tTOTAL) return (rTotal, tTOTAL);
        return (rSupply, tSupply);
    }

    function _takeMarketing(address sender, uint256 tMarketing) private {
        uint256 currentRate = _getRate();
        uint256 rMarketing = tMarketing * currentRate;
        _rOwned[address(this)] = _rOwned[address(this)] + rMarketing;
        if (_isExcluded[address(this)]) {
            _tOwned[address(this)] = _tOwned[address(this)] + tMarketing;
        }
        emit Transfer(sender, address(this), tMarketing);
    }

    function _burnFee(address sender, uint256 tBurn) private {
        uint256 currentRate = _getRate();
        uint256 rBurn = tBurn * currentRate;
        rTotal -= rBurn;
        tTOTAL -= tBurn;
        emit Transfer(sender, address(0), tBurn);
    }

    function calculateRewardFee(uint256 _amount, bool isBuy)
        private
        view
        returns (uint256)
    {
        uint256 rewardFeePerc = isBuy ? rewardFeePercB : rewardFeePercS;
        return (_amount * rewardFeePerc) / 100;
    }

    function calculateMarketingFee(uint256 _amount, bool isBuy)
        private
        view
        returns (uint256)
    {
        uint256 marketingFeePerc = isBuy
