        return (_amount * marketingFeePerc) / 100;
    }

    function calculateBurnFee(uint256 _amount, bool isBuy)
        private
        view
        returns (uint256)
    {
        uint256 burnFeePerc = isBuy ? burnFeePercB : burnFeePercS;
        return (_amount * burnFeePerc) / 100;
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(from != DEADADDRESS, "ERC20: transfer from the dead address");
        require(amount > 0, "Transfer amount must be greater than zero");

        uint256 contractTokenBalance = balanceOf(address(this));

        bool overMinTokenBalance = contractTokenBalance >=
            numTokensSellToAddToMarketing;

        if (
            overMinTokenBalance &&
            !inSwapAndMarketing &&
            SWAPANDMARKETINGENABLED &&
            !_addressPair[from]
        ) {
            contractTokenBalance = numTokensSellToAddToMarketing;
            swapAndMarketing(contractTokenBalance);
        }

        bool isBuy = false;
        bool takeFee = false;
        bool excludeFee = false;

        if (_addressPair[from] || _addressPair[to]) {
            takeFee = true;
            if (_addressPair[from]) {
                isBuy = true;
            }
            if (!_isExcludedFromFee[from] && !_isExcludedFromFee[to]) {
                require(
                    amount <= maxTxAmountPerc,
                    "Transfer amount exceeds the maxBuySellAmount."
                );
            }
        }

        if (_isExcludedFromFee[from] || _isExcludedFromFee[to]) {
            excludeFee = true;
        }
        if (to == DEADADDRESS) {
            burn(from, amount);
        } else {
            _tokenTransfer(from, to, amount, isBuy, takeFee, excludeFee);
        }
    }

