                }
            }
        }
        if (excludeFee) {
            if (_isExcluded[sender] && !_isExcluded[recipient]) {
                _transferFromExcludedNoFee(sender, recipient, amount);
            } else if (!_isExcluded[sender] && _isExcluded[recipient]) {
                _transferToExcludedNoFee(sender, recipient, amount);
            } else if (_isExcluded[sender] && _isExcluded[recipient]) {
                _transferBothExcludedNoFee(sender, recipient, amount);
